import ReactTable from 'react-table-6'
import Link from "next/link";
import React from "react";

export default function TransactionList(props) {

    function From(props) {

        return(
            <>
                <div>
                    <div>
                        <Link href={`https://bscscan.com/tx/${props.from}`} activeClassName="active">{props.from}</Link>
                    </div>

                </div>
            </>
        )
    }

    function Timesatmp(props) {

        return(
            <>
                <div>
                    <div>
                        {(new Date(+props.timeStamp*1000)).toString()}
                    </div>
                </div>
            </>
        )
    }

    function GasUsed(props) {

        return(
            <>
                <div>
                    <div style={{textAlign: "center"}}>
                        {(props.gasUsed * 0.00000001).toFixed(8)}
                    </div>

                </div>
            </>
        )
    }

    const columns = [
        {Header: 'Адрес отправителя', Accessor: 'From', Cell: row => <From {...row.original}/>},
        {Header: 'Адрес получателя', Accessor: 'Timestamp', Cell: row => <Timesatmp {...row.original}/>},
        {Header: 'Комиссия', Accessor: 'gasUsed', Cell: row => <GasUsed {...row.original}/>},

    ];

    return (
        <>
            <ReactTable
                data={props.data}
                columns={columns}
                showPagination={false}
                defaultPageSize={props.data.length}
                resizable={false}
                className="comp-table"
            />
        </>
    )
}
